features:
# automatic
@Uppercase = [ A Aacute Abreve Acircumflex Adieresis Agrave Amacron Aogonek Aring Atilde AE B C Cacute Ccaron Ccedilla Cdotaccent D Eth Dcaron Dcroat E Eacute Ecaron Ecircumflex Edieresis Edotaccent Egrave Emacron Eogonek F G Gbreve Gcommaaccent Gdotaccent H Hbar I Iacute Icircumflex Idieresis Idotaccent Igrave Imacron Iogonek J K Kcommaaccent L Lacute Lcaron Lcommaaccent Lslash M N Nacute Ncaron Ncommaaccent Eng Ntilde O Oacute Ocircumflex Odieresis Ograve Ohungarumlaut Omacron Oslash Otilde OE P Thorn Q R Racute Rcaron Rcommaaccent S Sacute Scaron Scedilla Scommaaccent Germandbls T Tbar Tcaron Tcedilla Tcommaaccent U Uacute Ucircumflex Udieresis Ugrave Uhungarumlaut Umacron Uogonek Uring V W Wacute Wcircumflex Wdieresis Wgrave X Y Yacute Ycircumflex Ydieresis Ygrave Z Zacute Zcaron Zdotaccent Delta Omega
];

# Prefix: Languagesystems


feature aalt {
# automatic
feature calt;
feature sups;
feature frac;
feature ordn;
feature locl;

} aalt;

feature calt {
lookupflag IgnoreMarks;

lookup ColonHeightByContext {
    sub @Uppercase colon' @Uppercase by colon.case;
    sub [zero one two three four five six seven eight nine]
        colon'
        [zero one two three four five six seven eight nine]
    by colon.case;
} ColonHeightByContext;
} calt;

feature case {

} case;

feature ccmp {
lookup ccmp_Other_1 {
  @CombiningTopAccentsExceptAcute = [brevecomb caroncomb circumflexcomb commaturnedabovecomb dieresiscomb dotaccentcomb gravecomb hungarumlautcomb macroncomb ringcomb tildecomb];
  @CombiningNonTopAccents = [cedillacomb ogonekcomb];

  sub [i j]' @CombiningTopAccentsExceptAcute by [idotless jdotless];
  sub [i j]' @CombiningNonTopAccents @CombiningTopAccentsExceptAcute by [idotless jdotless];

  sub i' acutecomb by idotless;
  sub i' @CombiningNonTopAccents acutecomb by idotless;
} ccmp_Other_1;

} ccmp;

feature sups {
# automatic
sub one by onesuperior;
sub two by twosuperior;
sub three by threesuperior;

} sups;

feature frac {
# automatic
sub one slash four by onequarter;
sub one slash two by onehalf;
sub three slash four by threequarters;

} frac;

feature ordn {
# automatic
sub [zero one two three four five six seven eight nine] [A a]' by ordfeminine;
sub [zero one two three four five six seven eight nine] [O o]' by ordmasculine;

} ordn;

feature liga {
# automatic
lookupflag IgnoreMarks;
sub f i by fi;
sub f l by fl;

} liga;

feature cpsp {
# automatic
pos @Uppercase <5 0 10 0>;

} cpsp;

feature locl {
lookup locl_latn_0 {
	script latn;
	language AZE;
	language CRT;
	language KAZ;
	language TAT;
	language TRK;
	sub i by idotaccent;
} locl_latn_0;

lookup locl_latn_1 {
	script latn;
	language ROM;
	language MOL;
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
	sub Tcedilla by Tcommaaccent;
	sub tcedilla by tcommaaccent;
} locl_latn_1;

} locl;
